import React from "react";

function Header(){

    const client="React";
    const title={
        flutter:'Flutter',
        react:'React'
    }
  
    return(
        <div className="navbar bg-dark rounded">
             <h1 className="text-white">
             {client==="React"?title.react:title.flutter}
             course
             </h1>
        </div>
    );
}
export default Header;
